from __future__ import print_function

import json
import subprocess
import sys


class IdToolError(Exception):
    pass


class ParseError(IdToolError):
    def __init__(self, message=None):
        IdToolError.__init__(self, message or 'Siegfried returned unexpected output')


def sf_tool(path):
    return subprocess.check_output(['sf', '-json', path])


def file_tool(path):
    return subprocess.check_output(['file', path]).strip()


def file_fallback(path):
    if 'text' in file_tool(path):
        return 'x-fmt/111'
    raise Exception('No format was found.')


def find_puid(sf_output):
    result = json.loads(sf_output)
    try:
        matches = result['files'][0]['matches']
    except KeyError as e:
        raise ParseError('Siegfried returned unexpected output. KeyError: {}.'.format(e))

    if len(matches) == 0:
        raise ParseError('No matches found.')

    match = matches[0]
    puid = None

    if 'puid' in match:
        puid = match['puid']
    elif 'id' in match:
        puid = match['id']
    else:
        raise ParseError

    if puid == 'UNKNOWN':
        raise IdToolError('Siegfried determined that the file format is UNKNOWN.')

    return puid


def main(path):
    try:
        print(find_puid(sf_tool(path)))
    except IdToolError:
        print(file_fallback(path))


if __name__ == '__main__':
    sys.exit(main(sys.argv[1]))

